import React from 'react';
import reactDOM from 'react-dom';
import { add, diff, mul, division } from './Add.js';


reactDOM.render(
  <>
    <ul>
      <li>Sum of two number is { add(40,3) }</li>
      <li>Difference of two number is { diff(40,2) }</li>
      <li>Multiplication of two number is { mul(30,2) }</li>
      <li>Division of two number is { division(30,2) }</li>
    </ul>
  </>,
  document.getElementById("root")
);
